SELECT COUNT(DISTINCT ws_order_number) AS web_sales_count, SUM(wr_return_ship_cost) AS total_shipping_cost, SUM(wr_net_loss) AS net_profit FROM web_sales ws JOIN web_returns wr ON ws.ws_order_number = wr.wr_order_number JOIN customer_address ca ON ws.ws_ship_addr_sk = ca.ca_address_sk JOIN web_site w ON ws.ws_web_site_sk = w.web_site_sk JOIN date_dim dd ON wr.wr_returned_date_sk = dd.d_date_sk WHERE ca.ca_state = 'CA' AND w.web_name = 'ExampleWebSite' AND dd.d_date BETWEEN '2023-01-01' AND '2023-03-01' AND ws.ws_warehouse_sk <> wr.wr_warehouse_sk;
